import { BrowserRouter, Routes, Route } from 'react-router-dom';
import HomePage from './Pages/home.js';
const App = () => {
  return (
    <BrowserRouter>
      <main>
        <Route path='/' element={<HomePage />} />
      </main>
    </BrowserRouter>
  );
};
export default App;
